import React from 'react'	
import data from '../../assets/data/datas.json'
import '../styles/card.sass'
function Card (props) {
	data = props.data
	return (
				<div className='dataCard'>
					{data.map((data) =>
					<li key={ data.id }> 
					{ data.title }
					<img src={ data.cover } alt={ data.title} />
					</li>
					 )}

		</div>
)}
export default Card;
